import React from 'react';

import './header.styles.scss';

const Header = () => (
  <div className="header">
    <div className="logo-container">
    </div>
    <div className="options">
      <Link className="option" to="/shop">SHOP</Link>
      <Link className="option" to="/">CONTACT</Link>
    </div>
  </div>
);
